import React from 'react';
import MovieForm from '../../components/movieForm/movieForm';

const CreateNewFilm = () => {
  return (
    <React.Fragment>
      <section>
        <h1>Cteare New Film</h1>
        <MovieForm />
      </section>
    </React.Fragment>
  );
};

export default CreateNewFilm;
